            <div class="CommonArea AppointmentBook">
                <div class="CommonHead">
                    <figure>
                        <img src="assets/images/reason-2.svg">
                    </figure>
                    <h5>Symptoms</h5> 
                </div> 
                   
                    <div class="CommonBody">
                        <div class="CommonForm">
                            <div class="row" *ngFor="let symptom of selectedSymptomps; let i=index"> 
                                <div class="col-sm-12" (click)="onSelectIndex(i)" >
                                    <div class="form-group">
                                        <label>&nbsp;</label>
        
                                        <div class="AcuteBox" id="AcuteOpen"> 
                                           <p>{{symptom.symptoms}}</p>
                                           <div class="AcuteList" id="AcuteFirst" *ngIf="selectedIndex==i">
                                                <ul>
                                                    <li *ngFor="let symptomobject of getSymptomList()" (click)="onSelectSymptom(i,symptomobject)">
                                                        <span class="Title">{{symptomobject.symptoms}}</span>
                                                        <span class="AcuteIcon"><img src="assets/images/file.svg"></span>
                                                    </li>
                                                   
                                                </ul>
                                                
                                            </div>
                                        </div>  
                                    </div>
                                </div>
        
                                <div class="col-sm-12">
                                    <div class="form-group">
                                        <div class="SymptomsRange">
                                            <label>Select Symtoms Range</label>
                                            <ul>
                                                <li (click)="onSeveritySymptom(i,1)">
                                                    <input type="radio" [checked]="symptom.severity==1?true:false" name="{{i+1}}">
                                                    <span> 1</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,2)">
                                                    <input type="radio" [checked]="symptom.severity==2?true:false"  name="{{i+1}}">
                                                    <span> 2</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,3)">
                                                    <input type="radio" [checked]="symptom.severity==3?true:false" name="{{i+1}}">
                                                    <span> 3</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,4)">
                                                    <input type="radio" [checked]="symptom.severity==4?true:false" name="{{i+1}}">
                                                    <span> 4</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,5)">
                                                    <input type="radio" [checked]="symptom.severity==5?true:false" name="{{i+1}}">
                                                    <span> 5</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,6)">
                                                    <input type="radio" [checked]="symptom.severity==6?true:false" name="{{i+1}}">
                                                    <span> 6</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,7)">
                                                    <input type="radio" [checked]="symptom.severity==7?true:false" name="{{i+1}}">
                                                    <span> 7</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,8)">
                                                    <input type="radio" [checked]="symptom.severity==8?true:false" name="{{i+1}}">
                                                    <span> 8</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,9)">
                                                    <input type="radio" [checked]="symptom.severity==9?true:false" name="{{i+1}}">
                                                    <span> 9</span>
                                                </li>
        
                                                <li (click)="onSeveritySymptom(i,10)">
                                                    <input type="radio" [checked]="symptom.severity==10?true:false" name="{{i+1}}">
                                                    <span> 10</span>
                                                </li>
                                            </ul>
                                        </div>
                                    </div>
                                </div> 
                            </div>
                            <div class="row">
                                <div class="col-sm-12">
                                    <div class="form-group">
                                        <label>&nbsp;</label>
        
                                        <div class="AcuteBox">
                                            <a (click)="onAddSympyom()" href="javascript:void(0);" class="AddSymptoms">+ Add Symptoms</a>
                                        </div>
                                    </div> 
                                </div>
                            </div>
        
                        </div>
                    </div>
            </div>

            <div class="CommonButon">
                <button class="Button" (click)="onNextData()" >Save</button>
            </div>
        </div> 
    </div>
</div>
